import React from 'react';

class Header extends React.Component {

  render() {
    console.log(this.props.pages);

    return (
      <div className="Header">
              {Object.keys(this.props.pages).map(pageName => (
                  <button key={pageName}>
                      {pageName}
                  </button>
              ))}
      </div>
    );
  }

}

export default Header;
